import React from 'react';
import Navtop from './components/Navtop';
import Banniereproduitaccueil from './components/BanniereProduitAccueil';
import banniereReveil from './assets/img/banniereReveil.png'

const Accueil = () => {
    return (
        <div>
            <Navtop/>
            <div className="w-100 main">
                <Banniereproduitaccueil titre="Réveil caméra" sousTitre="Surveiller en toute discrétion" background="linear-gradient(120deg, #fdfbfb 0%, #ebedee 100%)" image={banniereReveil} />
            </div>
        </div>
    );
}

export default Accueil;
